      </header>
      <section class='home'>
      </section>
      <section class='about'>
        <h2 class='section-heading'>
          About
        </h2>
      </section>
      <section class='projects'>
        <h2 class='section-heading'>
          Projects
        </h2>
      </section>
      <section class='contact'>
        <h2 class='section-heading'>
          Contact
        </h2>
      </section>
      <footer>

      </footer>
    </body>
  );
}

export default App;
